contracts/AquaHopeGovernance.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

/**
 * @title AquaHope Governance Contract
 * @dev Handles voting on borehole locations and project decisions
 * Uses AIT tokens for voting power
 */
contract AquaHopeGovernance is Ownable, ReentrancyGuard {
    // Voting periods
    uint256 public constant VOTING_PERIOD = 7 days;
    uint256 public constant EXECUTION_DELAY = 1 days;
    
    // Proposal structure
    struct Proposal {
        uint256 id;
        string title;
        string description;
        string location;
        uint256 budget;
        address proposer;
        uint256 startTime;
        uint256 endTime;
        uint256 forVotes;
        uint256 againstVotes;
        bool executed;
        bool cancelled;
        mapping(address => bool) hasVoted;
        mapping(address => uint256) votes;
    }
    
    // Proposal tracking
    mapping(uint256 => Proposal) public proposals;
    uint256 public proposalCount;
    
    // Voting power source (AIT token contract)
    address public aitToken;
    
    // Events
    event ProposalCreated(
        uint256 indexed proposalId,
        address indexed proposer,
        string title,
        string location,
        uint256 budget
    );
    event VoteCast(
        uint256 indexed proposalId,
        address indexed voter,
        bool support,
        uint256 votes
    );
    event ProposalExecuted(uint256 indexed proposalId);
    event ProposalCancelled(uint256 indexed proposalId);
    
    // Modifiers
    modifier onlyAITHolder() {
        require(aitToken != address(0), "AIT token not set");
        // Check if caller has AIT tokens
        (bool success, bytes memory data) = aitToken.call(
            abi.encodeWithSignature("balanceOf(address)", msg.sender)
        );
        require(success, "Failed to check AIT balance");
        uint256 balance = abi.decode(data, (uint256));
        require(balance > 0, "Must hold AIT tokens to participate");
        _;
    }
    
    constructor(address _aitToken) {
        aitToken = _aitToken;
    }
    
    /**
     * @dev Create a new proposal for a borehole location
     * @param title The title of the proposal
     * @param description Detailed description of the project
     * @param location The location where the borehole should be built
     * @param budget The budget required for the project
     */
    function createProposal(
        string memory title,
        string memory description,
        string memory location,
        uint256 budget
    ) external onlyAITHolder nonReentrant returns (uint256) {
        require(bytes(title).length > 0, "Title cannot be empty");
        require(bytes(description).length > 0, "Description cannot be empty");
        require(bytes(location).length > 0, "Location cannot be empty");
        require(budget > 0, "Budget must be greater than 0");
        
        uint256 proposalId = proposalCount++;
        Proposal storage proposal = proposals[proposalId];
        
        proposal.id = proposalId;
        proposal.title = title;
        proposal.description = description;
        proposal.location = location;
        proposal.budget = budget;
        proposal.proposer = msg.sender;
        proposal.startTime = block.timestamp;
        proposal.endTime = block.timestamp + VOTING_PERIOD;
        proposal.executed = false;
        proposal.cancelled = false;
        
        emit ProposalCreated(proposalId, msg.sender, title, location, budget);
        
        return proposalId;
    }
    
    /**
     * @dev Vote on a proposal
     * @param proposalId The ID of the proposal
     * @param support True for yes, false for no
     */
    function vote(uint256 proposalId, bool support) external onlyAITHolder nonReentrant {
        require(proposalId < proposalCount, "Invalid proposal ID");
        Proposal storage proposal = proposals[proposalId];
        
        require(block.timestamp >= proposal.startTime, "Voting not started");
        require(block.timestamp <= proposal.endTime, "Voting period ended");
        require(!proposal.hasVoted[msg.sender], "Already voted");
        require(!proposal.executed, "Proposal already executed");
        require(!proposal.cancelled, "Proposal cancelled");
        
        // Get voter's AIT balance
        (bool success, bytes memory data) = aitToken.call(
            abi.encodeWithSignature("balanceOf(address)", msg.sender)
        );
        require(success, "Failed to get AIT balance");
        uint256 votingPower = abi.decode(data, (uint256));
        
        require(votingPower > 0, "No voting power");
        
        // Record vote
        proposal.hasVoted[msg.sender] = true;
        proposal.votes[msg.sender] = votingPower;
        
        if (support) {
            proposal.forVotes += votingPower;
        } else {
            proposal.againstVotes += votingPower;
        }
        
        emit VoteCast(proposalId, msg.sender, support, votingPower);
    }
    
    /**
     * @dev Execute a proposal if it has passed
     * @param proposalId The ID of the proposal to execute
     */
    function executeProposal(uint256 proposalId) external onlyOwner nonReentrant {
        require(proposalId < proposalCount, "Invalid proposal ID");
        Proposal storage proposal = proposals[proposalId];
        
        require(block.timestamp > proposal.endTime, "Voting period not ended");
        require(!proposal.executed, "Proposal already executed");
        require(!proposal.cancelled, "Proposal cancelled");
        require(proposal.forVotes > proposal.againstVotes, "Proposal did not pass");
        
        proposal.executed = true;
        
        emit ProposalExecuted(proposalId);
        
        // Here you would implement the actual execution logic
        // For example, transferring funds to the project
    }
    
    /**
     * @dev Cancel a proposal (only owner)
     * @param proposalId The ID of the proposal to cancel
     */
    function cancelProposal(uint256 proposalId) external onlyOwner {
        require(proposalId < proposalCount, "Invalid proposal ID");
        Proposal storage proposal = proposals[proposalId];
        
        require(!proposal.executed, "Cannot cancel executed proposal");
        require(!proposal.cancelled, "Proposal already cancelled");
        
        proposal.cancelled = true;
        
        emit ProposalCancelled(proposalId);
    }
    
    /**
     * @dev Get proposal details
     * @param proposalId The ID of the proposal
     */
    function getProposal(uint256 proposalId) external view returns (
        uint256 id,
        string memory title,
        string memory description,
        string memory location,
        uint256 budget,
        address proposer,
        uint256 startTime,
        uint256 endTime,
        uint256 forVotes,
        uint256 againstVotes,
        bool executed,
        bool cancelled
    ) {
        require(proposalId < proposalCount, "Invalid proposal ID");
        Proposal storage proposal = proposals[proposalId];
        
        return (
            proposal.id,
            proposal.title,
            proposal.description,
            proposal.location,
            proposal.budget,
            proposal.proposer,
            proposal.startTime,
            proposal.endTime,
            proposal.forVotes,
            proposal.againstVotes,
            proposal.executed,
            proposal.cancelled
        );
    }
    
    /**
     * @dev Check if a user has voted on a proposal
     * @param proposalId The ID of the proposal
     * @param voter The voter's address
     */
    function hasVoted(uint256 proposalId, address voter) external view returns (bool) {
        require(proposalId < proposalCount, "Invalid proposal ID");
        return proposals[proposalId].hasVoted[voter];
    }
    
    /**
     * @dev Get the number of votes a user cast on a proposal
     * @param proposalId The ID of the proposal
     * @param voter The voter's address
     */
    function getVotes(uint256 proposalId, address voter) external view returns (uint256) {
        require(proposalId < proposalCount, "Invalid proposal ID");
        return proposals[proposalId].votes[voter];
    }
    
    /**
     * @dev Get the current state of a proposal
     * @param proposalId The ID of the proposal
     */
    function getProposalState(uint256 proposalId) external view returns (string memory) {
        require(proposalId < proposalCount, "Invalid proposal ID");
        Proposal storage proposal = proposals[proposalId];
        
        if (proposal.cancelled) {
            return "Cancelled";
        } else if (proposal.executed) {
            return "Executed";
        } else if (block.timestamp <= proposal.endTime) {
            return "Active";
        } else if (proposal.forVotes <= proposal.againstVotes) {
            return "Defeated";
        } else {
            return "Succeeded";
        }
    }
    
    /**
     * @dev Update AIT token address (only owner)
     * @param _aitToken The new AIT token address
     */
    function setAITToken(address _aitToken) external onlyOwner {
        require(_aitToken != address(0), "Invalid AIT token address");
        aitToken = _aitToken;
    }
}

contracts/DeFiYieldPool.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

/**
 * @title DeFi Yield Pool for AquaHope Donations
 * @dev Manages donation funds in DeFi protocols to generate yield for maintenance
 * Integrates with Aave for lending and yield generation
 */

// ✅ Aave Pool interface
interface IAavePool {
    function supply(
        address asset,
        uint256 amount,
        address onBehalfOf,
        uint16 referralCode
    ) external;

    function withdraw(
        address asset,
        uint256 amount,
        address to
    ) external returns (uint256);

    function getUserAccountData(address user)
        external
        view
        returns (
            uint256 totalCollateralETH,
            uint256 totalDebtETH,
            uint256 availableBorrowsETH,
            uint256 currentLiquidationThreshold,
            uint256 ltv,
            uint256 healthFactor
        );
}

// ✅ Minimal ERC20 interface for WETH
interface IERC20Minimal {
    function approve(address spender, uint256 amount) external returns (bool);
    function balanceOf(address account) external view returns (uint256);
}

// ✅ WETH interface
interface IWETH {
    function deposit() external payable;
    function withdraw(uint256 amount) external;
    function transfer(address to, uint256 amount) external returns (bool);
}

contract DeFiYieldPool is Ownable, ReentrancyGuard {
    // Aave V3 addresses (these would be different for each network)
    address public constant AAVE_POOL =
        0x87870Bca3F3fD6335C3F4ce8392D69350B4fA4E2; // Mainnet Aave V3 pool
    address public constant WETH =
        0xC02aaA39b223FE8D0A0e5C4F27eAD9083C756Cc2; // Mainnet WETH

    // Pool state
    uint256 public totalDeposited;
    uint256 public totalYieldGenerated;
    uint256 public totalWithdrawnForProjects;

    // Yield distribution
    uint256 public constant MAINTENANCE_PERCENTAGE = 30; // 30% for maintenance
    uint256 public constant PROJECT_PERCENTAGE = 70; // 70% for new projects

    // Tracking
    mapping(address => uint256) public donorContributions;
    mapping(address => uint256) public donorYieldEarned;

    // Events
    event FundsDeposited(address indexed donor, uint256 amount);
    event YieldGenerated(uint256 amount);
    event FundsWithdrawnForProject(address indexed project, uint256 amount);
    event MaintenanceFundsWithdrawn(uint256 amount);

    /**
     * @dev Deposit ETH into the yield pool
     * @param donor The address of the donor
     */
    function depositFunds(address donor)
        external
        payable
        onlyOwner
        nonReentrant
    {
        require(msg.value > 0, "Deposit amount must be greater than 0");
        require(donor != address(0), "Invalid donor address");

        // Convert ETH to WETH
        IWETH(WETH).deposit{value: msg.value}();

        // Approve Aave to spend WETH
        IERC20Minimal(WETH).approve(AAVE_POOL, msg.value);

        // Supply to Aave
        IAavePool(AAVE_POOL).supply(WETH, msg.value, address(this), 0);

        // Update tracking
        totalDeposited += msg.value;
        donorContributions[donor] += msg.value;

        emit FundsDeposited(donor, msg.value);
    }

    /**
     * @dev Withdraw funds for a specific project
     */
    function withdrawForProject(address projectAddress, uint256 amount)
        external
        onlyOwner
        nonReentrant
    {
        require(projectAddress != address(0), "Invalid project address");
        require(amount > 0, "Amount must be greater than 0");
        require(amount <= totalDeposited, "Insufficient funds");

        // Withdraw from Aave
        uint256 withdrawnAmount = IAavePool(AAVE_POOL).withdraw(
            WETH,
            amount,
            address(this)
        );

        // Convert WETH back to ETH
        IWETH(WETH).withdraw(withdrawnAmount);

        // Transfer to project
        payable(projectAddress).transfer(withdrawnAmount);

        totalWithdrawnForProjects += withdrawnAmount;

        emit FundsWithdrawnForProject(projectAddress, withdrawnAmount);
    }

    /**
     * @dev Withdraw maintenance funds
     */
    function withdrawMaintenanceFunds(uint256 amount)
        external
        onlyOwner
        nonReentrant
    {
        require(amount > 0, "Amount must be greater than 0");

        // Calculate available yield
        uint256 availableYield = getAvailableYield();
        require(amount <= availableYield, "Insufficient yield available");

        // Withdraw from Aave
        uint256 withdrawnAmount = IAavePool(AAVE_POOL).withdraw(
            WETH,
            amount,
            address(this)
        );

        // Convert WETH back to ETH
        IWETH(WETH).withdraw(withdrawnAmount);

        // Transfer to owner for maintenance
        payable(owner()).transfer(withdrawnAmount);

        emit MaintenanceFundsWithdrawn(withdrawnAmount);
    }

    /**
     * @dev Get the current yield generated
     */
    function getAvailableYield() public view returns (uint256) {
        return totalDeposited / 100; // assume 1% yield for demo
    }

    function getPoolStats()
        external
        view
        returns (
            uint256 deposited,
            uint256 yield,
            uint256 withdrawn
        )
    {
        return (totalDeposited, totalYieldGenerated, totalWithdrawnForProjects);
    }

    function getDonorStats(address donor)
        external
        view
        returns (uint256 contribution, uint256 yieldEarned)
    {
        return (donorContributions[donor], donorYieldEarned[donor]);
    }

    function emergencyWithdraw() external onlyOwner {
        uint256 totalBalance = IERC20Minimal(WETH).balanceOf(address(this));

        if (totalBalance > 0) {
            IAavePool(AAVE_POOL).withdraw(WETH, totalBalance, address(this));
            IWETH(WETH).withdraw(totalBalance);
            payable(owner()).transfer(totalBalance);
        }
    }

    receive() external payable {}
}

contracts/Donation.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract AquaHopeDonation is Ownable, ReentrancyGuard {
    // Core donation tracking
    uint256 public totalDonations;
    uint256 public totalDonors;

    // Integration contracts
    address public aitToken;
    address public yieldPool;
    address public governance;
    address public badgeNFT;

    // ENS Registry for name resolution
    address public ensRegistry;

    // Donation structure
    struct Donation {
        address donor;
        uint256 amount;
        string name;
        string email;
        string ensName; // Add ENS name field
        uint256 timestamp;
        string message;
        string location;
        bool tokensMinted;
        bool badgeMinted;
        uint256 tokenCode;
    }

    // Tracking
    mapping(address => uint256) public donorCount;
    mapping(address => uint256) public donorTotalAmount;
    mapping(address => string) public donorEmails;
    mapping(address => string) public donorEnsNames; // Track ENS names
    mapping(uint256 => bool) public usedTokenCodes;
    Donation[] public donations;

    // Events
    event DonationReceived(
        address indexed donor,
        uint256 amount,
        string name,
        string email,
        string ensName,
        string message,
        string location,
        uint256 timestamp,
        uint256 tokenCode
    );

    event TokensMinted(address indexed donor, uint256 amount);
    event BadgeMinted(address indexed donor, uint256 tokenId);
    event FundsDepositedToYield(address indexed donor, uint256 amount);
    event EnsNameUpdated(address indexed donor, string ensName);

    constructor() {
        // Owner is set by Ownable constructor
    }

    /**
     * @dev Main donation function with full DeFi/ReFi integration
     * @param _name Donor's name
     * @param _email Donor's email for token delivery
     * @param _message Donor's message
     * @param _location Preferred project location
     */
    function donate(
        string memory _name,
        string memory _email,
        string memory _message,
        string memory _location
    ) external payable nonReentrant {
        require(msg.value > 0, "Donation amount must be greater than 0");
        require(bytes(_name).length > 0, "Name cannot be empty");
        require(bytes(_email).length > 0, "Email cannot be empty");

        // Generate unique token code
        uint256 tokenCode = _generateTokenCode(msg.sender);
        require(!usedTokenCodes[tokenCode], "Token code collision");
        usedTokenCodes[tokenCode] = true;

        // Try to resolve ENS name
        string memory ensName = _resolveEnsName(msg.sender);

        // Create donation record
        donations.push(Donation({
            donor: msg.sender,
            amount: msg.value,
            name: _name,
            email: _email,
            ensName: ensName,
            timestamp: block.timestamp,
            message: _message,
            location: _location,
            tokensMinted: false,
            badgeMinted: false,
            tokenCode: tokenCode
        }));

        // Update totals
        totalDonations += msg.value;

        // Update donor stats
        if (donorCount[msg.sender] == 0) {
            totalDonors++;
        }
        donorCount[msg.sender]++;
        donorTotalAmount[msg.sender] += msg.value;
        donorEmails[msg.sender] = _email;

        // Store ENS name if found
        if (bytes(ensName).length > 0) {
            donorEnsNames[msg.sender] = ensName;
            emit EnsNameUpdated(msg.sender, ensName);
        }

        // Deposit funds to yield pool
        if (yieldPool != address(0)) {
            (bool success, ) = yieldPool.call{value: msg.value}(
                abi.encodeWithSignature("depositFunds(address)", msg.sender)
            );
            if (success) {
                emit FundsDepositedToYield(msg.sender, msg.value);
            }
        }

        emit DonationReceived(
            msg.sender,
            msg.value,
            _name,
            _email,
            ensName,
            _message,
            _location,
            block.timestamp,
            tokenCode
        );
    }

    /**
     * @dev Mint tokens and badge for a donation (called by owner after email verification)
     * @param donationIndex The index of the donation in the array
     */
    function mintTokensAndBadge(uint256 donationIndex) external onlyOwner {
        require(donationIndex < donations.length, "Invalid donation index");
        Donation storage donation = donations[donationIndex];

        require(!donation.tokensMinted, "Tokens already minted");
        require(!donation.badgeMinted, "Badge already minted");

        // Mint AIT tokens
        if (aitToken != address(0)) {
            (bool success, ) = aitToken.call(
                abi.encodeWithSignature(
                    "mintTokensForDonation(address,uint256,string)",
                    donation.donor,
                    donation.amount,
                    donation.email
                )
            );
            if (success) {
                donation.tokensMinted = true;
                emit TokensMinted(donation.donor, donation.amount);
            }
        }

        // Mint NFT badge
        if (badgeNFT != address(0)) {
            (bool success, bytes memory data) = badgeNFT.call(
                abi.encodeWithSignature(
                    "mintBadge(address,uint256,string,string)",
                    donation.donor,
                    donation.amount,
                    donation.location,
                    donation.message
                )
            );
            if (success) {
                uint256 tokenId = abi.decode(data, (uint256));
                donation.badgeMinted = true;
                emit BadgeMinted(donation.donor, tokenId);
            }
        }
    }

    /**
     * @dev Generate a unique token code for email delivery
     * @param donor The donor's address
     * @return A unique token code
     */
    function _generateTokenCode(address donor) internal view returns (uint256) {
        return uint256(keccak256(abi.encodePacked(
            donor,
            block.timestamp,
            block.prevrandao,
            donations.length
        )));
    }

    /**
     * @dev Resolve ENS name for an address
     * @param addr The address to resolve
     * @return The ENS name or empty string if not found
     */
    function _resolveEnsName(address addr) internal view returns (string memory) {
        if (ensRegistry == address(0)) {
            return "";
        }

        try IENSResolver(ensRegistry).name(addr) returns (string memory ensName) {
            return ensName;
        } catch {
            return "";
        }
    }

    /**
     * @dev Set integration contract addresses
     */
    function setIntegrationContracts(
        address _aitToken,
        address _yieldPool,
        address _governance,
        address _badgeNFT
    ) external onlyOwner {
        aitToken = _aitToken;
        yieldPool = _yieldPool;
        governance = _governance;
        badgeNFT = _badgeNFT;
    }

    /**
     * @dev Set ENS registry address
     * @param _ensRegistry The ENS registry contract address
     */
    function setEnsRegistry(address _ensRegistry) external onlyOwner {
        ensRegistry = _ensRegistry;
    }

    /**
     * @dev Get donation count
     */
    function getDonationCount() external view returns (uint256) {
        return donations.length;
    }

    /**
     * @dev Get donation details
     */
    function getDonation(uint256 _index) external view returns (
        address donor,
        uint256 amount,
        string memory name,
        string memory email,
        string memory ensName,
        uint256 timestamp,
        string memory message,
        string memory location,
        bool tokensMinted,
        bool badgeMinted,
        uint256 tokenCode
    ) {
        require(_index < donations.length, "Invalid donation index");
        Donation memory donation = donations[_index];
        return (
            donation.donor,
            donation.amount,
            donation.name,
            donation.email,
            donation.ensName,
            donation.timestamp,
            donation.message,
            donation.location,
            donation.tokensMinted,
            donation.badgeMinted,
            donation.tokenCode
        );
    }

    /**
     * @dev Get donation by token code
     */
    function getDonationByTokenCode(uint256 _tokenCode) external view returns (
        address donor,
        uint256 amount,
        string memory name,
        string memory email,
        string memory ensName,
        uint256 timestamp,
        string memory message,
        string memory location,
        bool tokensMinted,
        bool badgeMinted
    ) {
        for (uint256 i = 0; i < donations.length; i++) {
            if (donations[i].tokenCode == _tokenCode) {
                Donation memory donation = donations[i];
                return (
                    donation.donor,
                    donation.amount,
                    donation.name,
                    donation.email,
                    donation.ensName,
                    donation.timestamp,
                    donation.message,
                    donation.location,
                    donation.tokensMinted,
                    donation.badgeMinted
                );
            }
        }
        revert("Donation not found");
    }

    /**
     * @dev Get recent donations
     */
    function getRecentDonations(uint256 _count) external view returns (Donation[] memory) {
        uint256 length = donations.length;
        if (_count > length) {
            _count = length;
        }

        Donation[] memory recentDonations = new Donation[](_count);
        uint256 startIndex = length - _count;

        for (uint256 i = 0; i < _count; i++) {
            recentDonations[i] = donations[startIndex + i];
        }

        return recentDonations;
    }

    /**
     * @dev Get contract balance
     */
    function getContractBalance() external view returns (uint256) {
        return address(this).balance;
    }

    /**
     * @dev Get donor's total contribution
     */
    function getDonorTotalContribution(address donor) external view returns (uint256) {
        return donorTotalAmount[donor];
    }

    /**
     * @dev Get donor's email
     */
    function getDonorEmail(address donor) external view returns (string memory) {
        return donorEmails[donor];
    }

    /**
     * @dev Get donor's ENS name
     */
    function getDonorEnsName(address donor) external view returns (string memory) {
        return donorEnsNames[donor];
    }

    /**
     * @dev Check if token code is used
     */
    function isTokenCodeUsed(uint256 tokenCode) external view returns (bool) {
        return usedTokenCodes[tokenCode];
    }

    /**
     * @dev Emergency withdraw (only owner)
     */
    function emergencyWithdraw() external onlyOwner {
        uint256 balance = address(this).balance;
        require(balance > 0, "No funds to withdraw");

        payable(owner()).transfer(balance);
    }

    /**
     * @dev Fallback function to receive ETH
     */
    receive() external payable {
        // Allow direct ETH transfers but don't create donation records
    }
}

/**
 * @dev Interface for ENS resolution
 */
interface IENSResolver {
    function name(address addr) external view returns (string memory);
}

